import React, { useEffect, useState } from 'react';
import { useHistory, Link as RouterLink } from 'react-router-dom';
import { Button, Card, CardContent, Typography, makeStyles, Grid, TextField } from '@material-ui/core';

import Logo from './assets/images/download.png';
import { auth_user } from '../utils/helper';

// import mark from './assets/images/MicrosoftTeams-image.png'

const useStyles = makeStyles((theme) => ({
    root: {
        height: '100vh',
        minHeight: '100%'
    },
    backButton: {
        marginLeft: theme.spacing(2),
    },
    card: {
        overflow: 'visible',
        display: 'flex',
        position: 'relative',
        '& > *': {
            flexGrow: 1,
            flexBasis: '50%',
            width: '50%',
        },
        maxWidth: '475px',
        margin: '24px auto'
    },
    content: {
        padding: theme.spacing(4, 3, 5, 3) +"!important",
    },
    forgot: {
        textDecoration: 'none',
        paddingLeft: '16px',
    },
    margin: {
        marginTop: theme.spacing(1),
        marginBottom: theme.spacing(1),
    },
    logo: {
        width: '150px'
    },
    loginbtn: {
        marginTop: theme.spacing(1),
        padding: theme.spacing(1.5),
    }
}));

const Custom = () => {
    let history = useHistory();
    const classes = useStyles();
    const [msg, setMsg] = useState("")
    const [empno, setEmpno] = useState("")
    const [password, setPassword] = useState("")
    
    const submitSignIn = async (e) => {
        let ErrorMsg=" ";
        if (empno === ''  && password === '') {
            ErrorMsg="Please Enter Employee ID and Password "
            setMsg(ErrorMsg)
             return false
          }

        let user = await auth_user({empno, password});
        console.log(user)
        //console.log("submitSignIn console = ", user);
         ErrorMsg="Authentication Failed!!";
        if(user && user.passwordReset){
            console.log("passwordReset console = ", user);
            history.push("/reset-password");
        }else if(empno == "admin@cyntralabs.com" && password =="123123" ){
            console.log("isAuthented console = ", user);
            history.push("/uploaded-build");
        }else if(user && user.account_locked){
            ErrorMsg="Authentication Failed! Your account has been blocked please contact your admin to unblock it"
        }
        setMsg(ErrorMsg)
    }
    return (
        <>
        <Grid container justify="center" alignItems="center" className={classes.root+" loginBgImage"}>
            <Grid item xs={11} sm={7} md={6} lg={4}>
            <img  style={{display: "block",
    margin: "auto",paddingBotom:"2rem"}}  src={Logo}   alt="Logo"></img>
                <Card className={classes.card +" blurcard"}>
                    <CardContent className={classes.content}>     
                        <Grid container direction="column" spacing={4} justify="center">
                            <Grid item xs={12} className={"p-bt"}>
                                <Grid container justify="space-between">
                                    <Grid item>          
                                  <Typography color="textPrimary" gutterBottom variant="h4" style={{left:25, position:"absolute","color":"primary"}}>
                                  Sign in
                                  <div>
                                  <Typography variant="body2" color="textSecondary" style={{"paddingTop":"10px"}}>
                                          To keep connected with us.
                                        </Typography>
                                  </div>
                                  
                                 </Typography>
                                        <span style={{textAlign: "right",position:"relative","paddingLeft":"160px"}} >
                                        <img   src={mark} alt="Logo" style={{ height: "50px", paddingLeft:"90px"}}></img>
                                          </span>
                                        
                                    </Grid>
                                    
                                    {/* <img  style={{"paddingLeft":"180px", height:"60px", weight:"60px"}}  src={mark} alt="Logo"></img> */}
                                    <Grid item>
                                        <RouterLink to="/" className={classes.icon}>
                                            {/* <img alt="Auth method" className={classes.logo} src={Logo} /> */}

                                        </RouterLink>
                                    </Grid>
                                </Grid>
                            </Grid>
                            <Grid item xs={12} className={"p-tp"}>

                            <form>
                            <TextField
                                 
                                 fullWidth
                                 autoFocus
                                 label="Employee ID"
                                 margin="normal"
                                 name="EmployeeID"
                                 type="text"
                                 defaultValue={empno}
                                 variant="outlined"
                                 onChange={(e) => setEmpno(e.target.value)}
                                 
                            />
                             <TextField
                                 fullWidth
                                 label="Password"
                                 margin="normal"
                                 name="password"
                                 type="password"
                                 defaultValue={password}
                                 variant="outlined"
                                 onChange={(e) => setPassword(e.target.value)}
                             required = "true"/>
                             {(msg)?
                                 <Typography variant="body2" color="Error">{msg}</Typography>
                             :
                                 ""
                             }
                             <Button 
                                 margin="normal" 
                                 fullWidth 
                                 variant="contained" 
                                 color="primary" 
                                 className={classes.loginbtn} 
                                 onClick={(e) => submitSignIn(e)}
                                 >Custom</Button>
                            </form>
                                
                            </Grid>
                        </Grid>
                    </CardContent>
                </Card>
            </Grid>
        </Grid>
        </>
    );
};

export default Custom;
